import React from "react";
import "./App.css";
import Home from "./Components/Home";
import { Route, Routes as BrowserRouter } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <React.Fragment>
      <Router>
        <BrowserRouter>
          <Route path="/" element={<Home />} />
        </BrowserRouter>
      </Router>
    </React.Fragment>
  );
}

export default App;
